import React from 'react';

const ItemView = (product) => {
  console.log('in item view', product._id);
  const productExists = product && product._id;
  return productExists ? (
    <>
      <p>product.name</p>
      <p>{product.price}</p>
    </>
  ) : (
    <p>Empty</p>
  );
};
